import React, { Component } from "react";
import Swiper from "react-id-swiper";
import { Container } from "react-bootstrap";

class Gallery extends Component {
    render() {
        const params = {
            slidesPerView: "auto",
            spaceBetween: 30,
            pagination: {
                el: ".swiper-pagination",
                clickable: true
            }
        };
        return (
            <div>
                <Container className="mt-4 mb-5 pb-5">
                    <Swiper {...params}>
                        <div></div>
                        <img
                            src="https://i.pinimg.com/564x/6a/d1/73/6ad1734962b2fa0a6f5fbf49f32bb26b.jpg"
                            className="img-fluid"
                            alt="slide"
                        />
                         <img
                            src="https://i.pinimg.com/564x/89/e4/a8/89e4a82ef51c8d499b3c4d4874b727ea.jpg"
                            className="img-fluid"
                            alt="slide"
                        />
                         <img
                            src="https://i.pinimg.com/564x/a6/5e/34/a65e346316635e1a6ea61a0efcb4a24e.jpg"
                            className="img-fluid"
                            alt="slide"
                        />
                         <img
                            src="https://i.pinimg.com/564x/6c/a9/1a/6ca91a07406af8057dd3718ca127a6b6.jpg"
                            className="img-fluid"
                            alt="slide"
                        />
                    </Swiper>
                </Container>
            </div>
        );
    }
}

export default Gallery;
